import React, { Component } from 'react';

class Navbar extends Component {
    state = {};
    render() {
        return (
            <nav className="navbar navbar-light bg-light">
                <a className="navbar-brand">Navbar</a>
            </nav>
        );
    }
}

export default Navbar;
